import React from 'react'
// import { BrowserRouter as Router, Link } from 'react-router-dom';

const NavbarComponent = () => {

  const handleDropdownHover = () => {
    const dropdownMenu = document.getElementById('dropdown-menu')
    dropdownMenu.style.display = 'block'
  }

  const handleDropdownLeave = () => {
    const dropdownMenu = document.getElementById('dropdown-menu')
    dropdownMenu.style.display = 'none'
  }

  return (
    <div className='navbarStyle'>
      aaa
    </div>
  )
}

export default NavbarComponent

const navbarStyle = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  backgroundColor: 'black',
  margin: '0px',
  color: '#fff',
  padding: '10px',
  width: '100%'
}

const logoStyle = {
  fontSize: '20px',
  fontWeight: 'bold',
}

const actionsStyle = {
  display: 'flex',
  alignItems: 'center',
}

const buttonStyle = {
  backgroundColor: '#007bff',
  color: '#fff',
  border: 'none',
  padding: '8px 16px',
  marginRight: '10px',
  cursor: 'pointer',
}

const dropdownStyle = {
  position: 'relative',
}

const dropdownToggleStyle = {
  backgroundColor: 'transparent',
  color: '#fff',
  border: 'none',
  cursor: 'pointer',
}

const dropdownMenuStyle = {
  position: 'absolute',
  top: '100%',
  right: 0,
  backgroundColor: '#333',
  color: '#fff',
  padding: '8px',
  display: 'none',
}

const linkStyle = {
  display: 'block',
  color: '#fff',
  textDecoration: 'none',
  marginBottom: '4px',
}
